import { useState } from "react";
import Chat from "../components/Chat";
import Flashcards from "../components/Flashcards";
import Summary from "../components/Summary";
import VideoPlayer from "../components/VideoPlayer";
import ChapterTranscript from "../components/ChapterTranscript";

function Home() {
  const [activeTab, setActiveTab] = useState("chat");
  const [videoId, setVideoId] = useState("");
  const [videoUrl, setVideoUrl] = useState("");
  const [showInput, setShowInput] = useState(false);

  const handleVideoSubmit = () => {
    const regex = /(?:youtube\.com\/(?:[^\/\n\s]+\/\S+\/|(?:v|e(?:mbed)?)\/|(?:v=|\S*?[?&]v=))|youtu\.be\/)([^"&?\/\s]{11})/;
    const match = videoUrl.match(regex);
    if (match) {
      setVideoId(match[1]);
    } else {
      alert("Please enter a valid YouTube URL.");
    }
  };

  return (
    <div style={styles.appContainer}>
      <header style={styles.header}>
        <div style={styles.logo}>YouLearn</div>
      </header>

      <div style={styles.uploadSection}>
        <input
          type="text"
          placeholder="Enter YouTube Video URL"
          value={videoUrl}
          onChange={(e) => setVideoUrl(e.target.value)}
          style={styles.videoInput}
        />
        <button onClick={handleVideoSubmit} style={styles.submitButton}>Load Video</button>
      </div>

      <div style={styles.mainContent}>
        <div style={styles.leftContainer}>
          <div style={styles.videoSection}>
            {videoId ? <VideoPlayer videoId={videoId} /> : <p>No video loaded.</p>}
          </div>
          <div style={styles.chapterTranscriptSection}>
            <ChapterTranscript />
          </div>
        </div>

        <div style={styles.rightContainer}>
          <div style={styles.tabs}>
            <button style={activeTab === "chat" ? styles.activeTab : styles.tab} onClick={() => setActiveTab("chat")}>
              Chat
            </button>
            <button style={activeTab === "flashcards" ? styles.activeTab : styles.tab} onClick={() => setActiveTab("flashcards")}>
              Flashcards
            </button>
            <button style={activeTab === "summary" ? styles.activeTab : styles.tab} onClick={() => setActiveTab("summary")}>
              Summary
            </button>
          </div>
          <div style={styles.content}>
            {activeTab === "chat" && <Chat />}
            {activeTab === "flashcards" && <Flashcards />}
            {activeTab === "summary" && <Summary />}
          </div>
        </div>
      </div>
    </div>
  );
}

const styles = {
  appContainer: { height: "100vh", display: "flex", flexDirection: "column", backgroundColor: "#", color: "#e0e0e0", fontFamily: "Arial, sans-serif" },
  header: { display: "flex", alignItems: "center", padding: "1rem", backgroundColor: "#1e1e1e", borderBottom: "1px solid #333", boxShadow: "0px 2px 4px rgba(0, 0, 0, 0.2)" },
  logo: { fontSize: "1.5rem", fontWeight: "bold", color: "#00ff9d" },
  uploadSection: { display: "flex", justifyContent: "center", alignItems: "center", backgroundColor: "#1e1e1e", padding: "1rem", borderBottom: "1px solid #333" },
  videoInput: { width: "60%", padding: "0.5rem", borderRadius: "4px", border: "1px solid #333", backgroundColor: "#222", color: "#fff", fontSize: "1rem", marginRight: "0.5rem" },
  submitButton: { padding: "0.5rem 1rem", borderRadius: "4px", border: "none", backgroundColor: "#00ff9d", color: "#0f0f0f", cursor: "pointer", fontWeight: "bold" },
  showInputButton: { padding: "0.5rem 1rem", borderRadius: "4px", border: "none", backgroundColor: "#007bff", color: "#fff", cursor: "pointer", fontWeight: "bold" },
  mainContent: { display: "flex", flex: 1, flexDirection: "row", gap: "1rem", padding: "1rem" },
  leftContainer: { flex: 1, display: "flex", flexDirection: "column", backgroundColor: "#181818", borderRadius: "8px", overflow: "hidden", boxShadow: "0 2px 8px rgba(0, 0, 0, 0.2)" },
  rightContainer: { flex: 1, display: "flex", flexDirection: "column", gap: "1rem", backgroundColor: "#181818", borderRadius: "8px", overflow: "hidden", boxShadow: "0 2px 8px rgba(0, 0, 0, 0.2)" },
  videoSection: { height: "40vh", backgroundColor: "#202020", padding: "1rem", display: "flex", justifyContent: "center", alignItems: "center", marginBottom: "1rem" },
  chapterTranscriptSection: { padding: "1rem", backgroundColor: "#222", borderTop: "1px solid #333", flex: 1, overflowY: "auto" },
  tabs: { display: "flex", backgroundColor: "#1e1e1e", padding: "0.5rem", borderBottom: "1px solid #333" },
  tab: { flex: 1, textAlign: "center", padding: "0.75rem", cursor: "pointer", backgroundColor: "transparent", border: "none", color: "#a0a0a0", fontSize: "1rem", transition: "color 0.3s, border-bottom 0.3s" },
  activeTab: { color: "#fff", borderBottom: "3px solid #00ff9d", fontWeight: "bold" },
  content: { flex: 1, padding: "1rem", backgroundColor: "#1e1e1e", borderRadius: "8px", overflowY: "auto" }
};

export default Home;
